int main(){
    cin.tie(0)->sync_with_stdio(0);
    // cout << pre << '\n';
    int t; cin >> t;
    while (t--){
        ull n; cin >> n;
        if (n>=mod) cout << 0 << '\n';
        else{
            ull val=0;
            for (ull i=0;i<5;++i){
                val*=p1;
                // cout << (int)pre[n/sz*6+i]-buf << " ";
                int tmp=pre[n/sz*5+i];
                if (tmp=='!') tmp='\\';
                else if (tmp=='~') tmp='?';
                val+=tmp-buf;
            }
            for (ull i=(n/sz)*sz+1;i<=n;++i){
                val=val*i%mod;
            }
            cout << val << '\n';
            // ull val2=1;
            // for (ull i=1;i<=n;++i){
            //     val2=val2*i%mod;
            // }
            // cout << val2 << '\n';
            // assert(val==val2);
        }
    }
}